tables.table_schema:
CREATE TABLE solar_panel_efficiency_ratings (
  panel_id INT PRIMARY KEY,
  efficiency_rating FLOAT,
  installation_date DATE
);

CREATE TABLE SolarPanels (
  panel_id INT PRIMARY KEY,
  brand VARCHAR(50),
  efficiency_rating FLOAT
);

CREATE TABLE PerformanceData (
  data_id INT PRIMARY KEY,
  panel_id INT REFERENCES SolarPanels(panel_id),
  date TIMESTAMP,
  efficiency FLOAT
);

CREATE TABLE solar_panels (
  panel_id INT PRIMARY KEY,
  panel_name STRING,
  efficiency_rating FLOAT
);

CREATE TABLE panel_performance (
  performance_id INT PRIMARY KEY,
  panel_id INT,
  performance_date DATE,
  energy_generated FLOAT
);

CREATE TABLE panel_usage (
  usage_id INT PRIMARY KEY,
  panel_id INT,
  usage_date DATE,
  usage_hours INT
);

CREATE TABLE panel_manufacturer (
    manufacturer_id INT PRIMARY KEY,
    manufacturer_name VARCHAR(255) NOT NULL
);
